import React from 'react'
import { useState } from 'react'

interface Props {
    time: number,
    key: number
}

export default function TimeButton(props: Props) {
  return (
    <tr>
        <td>
            <button className='timeButton' key={props.key}>
                {props.time}
            </button>
            <button className='confirmButton'>
                Confirm
            </button>
        </td>
    </tr>
  )
}
